import React from "react";
import './about.css'

function About () {
  return (

    <div class="container">

      <div class="jumbotron">
        <h1>About Me</h1>

      </div>

      <div class="wrapper">

      <div class="row">

        <div class="col-md-3">
          <img rc="https://pbs.twimg.com/profile_images/1291995454071341057/FnrlfRn2_400x400.jpg" alt="imgOfMe"
            class="img-thumbnail">
          </img>
        </div>

      </div>

      </div>


    </div>


  );
};

export default About;
